import React from 'react';
import 'C:\\Users\\Mysterious\\Youtubelite\\frontend\\src\\resources\\main.css'
import Homepage from './resources/Pages/Home';
//import menu  icon component
import {Menuicon} from '../src/resources/Component/Logo/Menuicon'
import { Contenticon } from './resources/Component/Icon/Contenticon';
//import svg icon
import menuicon from "C:\\Users\\Mysterious\\Youtubelite\\frontend\\src\\public\\icons8-menu.svg"
import videoicon from "C:\Users\Mysterious\Youtubelite\frontend\src\public\video.svg"

function App() {
  return (
    <div className = "container">
      <div className = "menubar">
        <div className="iconmenu">
            <Menuicon  menuicon = {menuicon}/>
        </div>
        <div className = "iconcontent">
           <Contenticon icon = {videoicon}/>
        </div>
       </div>

       <div className="App">
        <Homepage/>
      </div>
    </div>

  );
}

export default App;
